import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Physical AI & Humanoid Robotics</h1>
        <p>
          A Comprehensive Guide to ROS 2 and Humanoid Control Systems
        </p>
        <p>
          <a href="https://github.com/ZainAfzalHashmi/Physical-AI-Humanoid-Robotics-hackathon" target="_blank" rel="noopener noreferrer">
            View Documentation
          </a>
        </p>
        <p>
          <a href="/hackathon-ai-book/" target="_blank" rel="noopener noreferrer">
            View Book Content
          </a>
        </p>
      </header>
    </div>
  );
}

export default App;
